import React, { Component } from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import { Link } from 'react-router-dom';
import { Button,Form, Nav,Navbar,Container,NavDropdown,FormControl } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
const Footer = () => {

    
  return(
      <div className="footer">
        <div className='footer-container'>
            <div className='row'>
                <div className='footer-col'>
                    <h4>More Links</h4>
                    <ul><a href="/property-details">Details Page</a></ul>
                </div>
                <div className='footer-col'>
                    <h4>About Us</h4>
                    <ul><a href="/"></a></ul>
                </div>
                <div className='footer-col'>
                    <h4>Follow Us</h4>
                    <ul><a href="#"><i className='fab fa-facebook-f'></i></a></ul>
                    <ul><a href="#"><i className='fab fa-twitter-f'></i></a></ul>
                    <ul><a href="#"><i className='fab fa-instagram-f'></i></a></ul>
                    <ul><a href="#"><i className='fab fa-linkedin-f'></i></a></ul>
                </div>
                
            </div>
        </div>
      </div>
)
};

export default Footer;
